DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `InActiveInterestsScheduler`()
BEGIN
DECLARE done INT DEFAULT FALSE;
	DECLARE getInterestId int(12);
    declare getpenaltyPrice varchar(100);
	declare getrefundamount varchar(100);
    declare getinvesterid int(12);
	DECLARE cur1 CURSOR FOR select ivi.interest_id,round(((pvt.purchase_price+pvt.refurbish_amount)*(0.1/100))) as price,
    (idat.remain_amount + (pvt.purchase_price+pvt.refurbish_amount))as refund_amount,
    ivi.invester_id
    from invester_vehicle_interest_tbl ivi inner join purchased_vehicle_details_tbl pvt
    on pvt.vehicle_id=ivi.vehicle_id and pvt.is_active='Y'
    inner join invester_debit_amount_tbl idat on idat.invester_id=ivi.invester_id and idat.is_active='Y'
	where ivi.penalty_date <= now() and 
    ivi.vehicle_id not in 
    (select vehicle_id from invester_payments_tbl where invester_id=ivi.invester_id and is_payment_done='Y');
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    OPEN cur1;
    read_loop: LOOP
      FETCH cur1 INTO getInterestId,getpenaltyPrice,getrefundamount,getinvesterid;
      IF done THEN
        LEAVE read_loop;
      END IF;      
	SET SQL_SAFE_UPDATES = 0;
      update invester_vehicle_interest_tbl set is_active='N',penalty_amount=getpenaltyPrice,is_refunded='Y' where interest_id=getInterestId and is_active = 'Y';
update invester_debit_amount_tbl set remain_amount=getrefundamount where invester_id=getinvesterid and is_active='Y';

	END LOOP;
    CLOSE cur1;
END ;;
DELIMITER ;
