CREATE DEFINER=`root`@`%` PROCEDURE `salesheaddashboard`(in showroom_id_set int)
begin
declare showroom_id_get int;
declare showroomIds varchar(1000);
if showroom_id_set is null then
set showroom_id_get = 0;
else 
set showroom_id_get = showroom_id_set;
end if;
set showroomIds = Getshowrmid(showroom_id_get); 

select 
(select count(distinct if(a.status='HOT+',a.customer_id,NULL)) as 'HOT+'  from
(select slmt.customer_id,
case when datediff(date(slmt.planning_to_by),date(now()))<=15  then 'HOT+'
     when datediff(date(slmt.planning_to_by),date(now()))<=30  then 'HOT'
     when datediff(date(slmt.planning_to_by),date(now()))<=60  then 'WARM'
     when datediff(date(slmt.planning_to_by),date(now()))>=60  then 'COLD' end  as status
     from customer_status_update_tbl  csut inner join sales_lead_master_tbl slmt on slmt.customer_id=csut.customer_id  
and slmt.is_active='Y' and csut.is_active='Y'
 inner join employee_showroom_assignment_tbl esat on esat.employee_id=slmt.added_by  and esat.is_active='Y'
 inner join showrooms_tbl st on esat.showroom_id=st.showroom_id and st.is_active='Y'
 where find_in_set(st.showroom_id,showroomIds)
group by csut.customer_id)a) as 'HOTplus',

(select count(distinct if(a.status='HOT' ,a.customer_id,NULL)) as 'HOT'   from
(select slmt.customer_id,
case when datediff(date(slmt.planning_to_by),date(now()))<=15  then 'HOT+'
     when datediff(date(slmt.planning_to_by),date(now()))<=30  then 'HOT'
     when datediff(date(slmt.planning_to_by),date(now()))<=60  then 'WARM'
     when datediff(date(slmt.planning_to_by),date(now()))>=60  then 'COLD' end  as status
     from customer_status_update_tbl  csut inner join sales_lead_master_tbl slmt on slmt.customer_id=csut.customer_id  
and slmt.is_active='Y' and csut.is_active='Y'
 inner join employee_showroom_assignment_tbl esat on esat.employee_id=slmt.added_by  and esat.is_active='Y'
 inner join showrooms_tbl st on esat.showroom_id=st.showroom_id and st.is_active='Y'
 where find_in_set(st.showroom_id,showroomIds)
group by csut.customer_id)a) as 'HOT',

(select count(distinct if(a.status='WARM' ,a.customer_id,NULL)) as 'WARM'  from
(select slmt.customer_id,
case when datediff(date(slmt.planning_to_by),date(now()))<=15  then 'HOT+'
     when datediff(date(slmt.planning_to_by),date(now()))<=30  then 'HOT'
     when datediff(date(slmt.planning_to_by),date(now()))<=60  then 'WARM'
     when datediff(date(slmt.planning_to_by),date(now()))>=60  then 'COLD' end  as status
     from customer_status_update_tbl  csut inner join sales_lead_master_tbl slmt on slmt.customer_id=csut.customer_id  
and slmt.is_active='Y' and csut.is_active='Y'
 inner join employee_showroom_assignment_tbl esat on esat.employee_id=slmt.added_by  and esat.is_active='Y'
 inner join showrooms_tbl st on esat.showroom_id=st.showroom_id and st.is_active='Y'
 where find_in_set(st.showroom_id,showroomIds)
group by csut.customer_id)a) as 'WARM',

(select count(distinct if(a.status='COLD',a.customer_id,NULL)) as 'COLD'  from
(select slmt.customer_id,
case when datediff(date(slmt.planning_to_by),date(now()))<=15  then 'HOT+'
     when datediff(date(slmt.planning_to_by),date(now()))<=30  then 'HOT'
     when datediff(date(slmt.planning_to_by),date(now()))<=60  then 'WARM'
     when datediff(date(slmt.planning_to_by),date(now()))>=60  then 'COLD' end  as status
     from customer_status_update_tbl  csut inner join sales_lead_master_tbl slmt on slmt.customer_id=csut.customer_id  
and slmt.is_active='Y' and csut.is_active='Y'
 inner join employee_showroom_assignment_tbl esat on esat.employee_id=slmt.added_by  and esat.is_active='Y'
 inner join showrooms_tbl st on esat.showroom_id=st.showroom_id and st.is_active='Y'
 where find_in_set(st.showroom_id,showroomIds)
group by csut.customer_id)a) as 'COLD',

DATE_FORMAT(DATE(NOW()), '%D-%b') 'todayLabel',

count(distinct if(a.customer_status in (2,3) and a.follow_date_time<date(now()),a.customer_id,NULL)) as overDues,

count(distinct if(a.customer_status in (2,3) and a.follow_date_time=date(now()),a.customer_id,NULL)) as todayPendFollowups,

(select count(distinct slmt.customer_id) as day_enquiry
from sales_lead_master_tbl slmt 
inner join employee_showroom_assignment_tbl esat on esat.employee_id=slmt.added_by
and slmt.is_active='Y' and esat.is_active='Y'
inner join showrooms_tbl st on st.showroom_id=esat.showroom_id
where find_in_set(st.showroom_id,showroomIds) and date(slmt.added_on)=date(now())) as todayEnquiries,

count(distinct if(a.customer_status=3 and a.followup_status=3 and date(a.date_time)=date(now()),a.customer_id,NULL)) as todayTestDrives,

count(distinct if(a.customer_status=3 and a.followup_status=1  and date(a.date_time)=date(now()),a.customer_id,NULL)) as todayVisits,

DATE_FORMAT(DATE(NOW()), '%b-%Y') 'monthlyLabel',


count(distinct if(a.customer_status=3 and a.followup_status=6 and month(a.follow_date_time)=month(now()) and year(a.follow_date_time)=year(now())
,a.customer_id,NULL)) as monthlyBooked,

(select count(distinct slmt.customer_id) as monthly_enquiry
from sales_lead_master_tbl slmt 
inner join employee_showroom_assignment_tbl esat on esat.employee_id=slmt.added_by
and slmt.is_active='Y' and esat.is_active='Y'
inner join showrooms_tbl st on st.showroom_id=esat.showroom_id
where find_in_set(st.showroom_id,showroomIds) and month(slmt.added_on)=month(now()) and year(slmt.added_on)=year(now())) as monthlyEnquiries,

(select count(distinct vsdt.vehicle_id)
from vehicle_sales_details_tbl vsdt 
 inner join employee_showroom_assignment_tbl esat on esat.employee_id=vsdt.sold_by  and esat.is_active='Y'
 inner join showrooms_tbl st on esat.showroom_id=st.showroom_id and st.is_active='Y'
 and month(vsdt.sold_on)=month(now()) and year(vsdt.sold_on)=year(now())
 where find_in_set(st.showroom_id,showroomIds)) as monthlySoldCars,
 
 count(distinct if(a.customer_status in (1,2,3) and 
 month(a.follow_date_time)=month(now()) and year(a.follow_date_time)=year(now()),a.customer_id,NULL)) as monthlyActiveLeads,
 
 count(distinct if(a.customer_status in (2,3) and date(a.follow_date_time)<date(now()) and month(a.follow_date_time)=month(now())
 and year(a.follow_date_time)=year(now()) ,a.customer_id,NULL)) as monthlyOverDues,
 
count(distinct if(a.customer_status=2 and a.follow_up='Y',a.customer_id,NULL)) as 'twentyFourHours',
count(distinct if(a.customer_status=2 and a.follow_up='A',a.customer_id,NULL)) as 'fortyEightHours',
count(distinct if(a.customer_status=2 and a.follow_up='R',a.customer_id,NULL)) as 'greaterThanFortyEightHours',
count(distinct if(a.customer_status=2 ,a.customer_id,NULL)) as 'pendingFollowUpCount'
 
 

from
(select slmt.customer_id,st.showroom_id,csut.customer_status,csut.followup_status,csut.date_time,csut.created_on,slmt.added_on,
case when csut.customer_status=2 then date(csut.followup_date)
     when csut.customer_status=1 then date(csut.created_on)
    when csut.customer_status=3 and csut.followup_status in(1,2,3) then date(csut.date_time)
    when csut.customer_status=3 and csut.followup_status=6 then date(csut.created_on) end as follow_date_time,
    
    case when csut.followup_date>= DATE_SUB(NOW(), INTERVAL 24 HOUR) then 'Y' 
      when csut.followup_date>= DATE_SUB(NOW(), INTERVAL 48 HOUR) then 'A'
      when csut.followup_date< DATE_SUB(NOW(), INTERVAL 48 HOUR) then 'R'  end as follow_up
    
 from customer_status_update_tbl  csut inner join sales_lead_master_tbl slmt on slmt.customer_id=csut.customer_id  
and slmt.is_active='Y' and csut.is_active='Y'
left join employee_showroom_assignment_tbl esat on esat.employee_id=csut.updated_by  and esat.is_active='Y'
left join showrooms_tbl st on esat.showroom_id=st.showroom_id and st.is_active='Y'
where find_in_set(st.showroom_id,showroomIds)
group by csut.customer_id)a;
       
end ;;
